import React, {useState} from "react";
import './styles.css';
import {Link} from "react-router-dom";

function main(){
    return(
        <div>
            <header className="header-class">
                <ul>
                    <li>
                        <h2>IMG</h2>
                    </li>
                    <li>
                        <h1>NeighBe</h1>
                    </li>
                    <li>
                        {/*<div>*/}
                            <ul>
                                <li>
                                    <Link to="/signup">Join</Link>
                                </li>
                                <li>
                                    <Link to="/login">Login</Link>
                                </li>
                            </ul>
                        {/*</div>*/}
                    </li>
                </ul>
            </header>
        </div>
    );
}

export default main;
